import React, { Component } from 'react'
import {userProvider} from './userContext'
import ClassB from './ClassB'
class ClassA extends Component {
    render() {
        return (
            <div>
                <userProvider value="hamza">
                    <ClassB />
                </userProvider>
            </div>
        )
    }
}
export default ClassA
